import React from "react";
import Scroll from "react-scroll";
import styled from "styled-components";
import logo from "./logo.png";
import { Card, AppProvider } from "@shopify/polaris";

var Element = Scroll.Element;

const Post = styled.div`
  background: #1a2238;
`;

const Item = styled.div`
  margin-left: 1vw;
  height: 480px;
  width: 320px;
  border: solid #d72323 5px;
  border-radius: 1.2rem;
  margin-bottom: 1rem;
`;

const CardDescription = styled.div`
  display: flex;
  justify-content: flex-start;
  flex-direction: column;
  width: 250px;
  margin-bottom: -20px;
  margin-left: 30px;
  color: #fff;
`;

const CardImage = styled.img`
  width: 240px;
  height: 170px;
  margin-left: 35px;
  margin-top: 35px;
  border: solid #fff 0.2px;
  border-radius: 1rem;
`;

function Verticalscroll() {
  return (
    <AppProvider>
      <Post>
        <Card>
          <Item>
            <CardImage src={""} alt="" />
            <CardDescription>
              <h1
                style={{
                  fontSize: "20px",
                  marginBottom: "-20px",
                  padding: "0",
                  fontWeight: "bold",
                }}
              >
                Crypto Market Tracker
              </h1>
              <br /> Libraries Used:
              <br />- Axios [For API]
              <br />- Framer Motion[Animation]
              <br />- Styled-Components[CSS]
            </CardDescription>
          </Item>
          <Item>
            <CardImage src={""} alt="" />
            <CardDescription>
              <h1
                style={{
                  fontSize: "20px",
                  marginBottom: "-20px",
                  padding: "0",
                  fontWeight: "bold",
                }}
              >
                Crypto Market Tracker
              </h1>
              <br /> Libraries Used:
              <br />- Axios [For API]
              <br />- Framer Motion[Animation]
              <br />- Styled-Components[CSS]
            </CardDescription>
          </Item>
          <Item>
            <CardImage src={""} alt="" />
            <CardDescription>
              <h1
                style={{
                  fontSize: "20px",
                  marginBottom: "-20px",
                  padding: "0",
                  fontWeight: "bold",
                }}
              >
                Crypto Market Tracker
              </h1>
              <br /> Libraries Used:
              <br />- Axios [For API]
              <br />- Framer Motion[Animation]
              <br />- Styled-Components[CSS]
            </CardDescription>
          </Item>
        </Card>
      </Post>
    </AppProvider>
  );
}

export default Verticalscroll;
